import React, { Component } from "react";
import lehigh from "../images/lehigh.png";

class Education extends Component {
  state = {};
  render() {
    return (
      <div>
        <div className="lehigh-text-container">
          <h3 className="lehigh-name">LEHIGH UNIVSERSITY</h3>
          <h3 className="lehigh-address">Bethlehem, Pennsylvania</h3>
          <br />
          <br />
          <p className="lehigh-major">
            Bachelor of Science; <i>Finance</i>
          </p>
          <p>
            <i>Minor in Psychology</i>
          </p>
        </div>
        <div className="lehigh-photo-container">
          <img
            className="lehigh-photo"
            src={lehigh}
            alt="Lehigh University"
          ></img>
        </div>
      </div>
    );
  }
}

export default Education;
